import { Button } from "@mui/material";
import { title } from "process";
import { FC } from "react";

interface Props{
    text:string
}

const MyButton:FC<Props> = ({text}) =>{
    return (
        <Button
            sx={{
                backgroundColor: 'orange',    // Color de fondo inicial
                
            }}
        >
            {text}
        </Button>
    );
}

export default MyButton
